import React, { Component } from 'react';
import Login from './Login'
import IntelCeleron from './upgrades/IntelCeleron'
import IntelI5 from './upgrades/IntelI5.js'

export default class Shop extends Component {
  render() {
  	const {upgrades} = this.props
    return (
    	<div>
	      <IntelCeleron upgrades={upgrades[0]} id="0" myCoin={this.props.myCoin} gameFunction={this.props.gameFunction}/>
	      <IntelI5 upgrades={upgrades[1]} id="1" myCoin={this.props.myCoin} gameFunction={this.props.upgrade}/>
      </div>
    );
  }
}
